import React from "react";
import AppLayout from "../components/AppLayout";
import { Form, Input } from "antd";
import Head from "next/head";

const Signup = () => {
  return (
    <AppLayout>
      <Head>
        <title>회원가입 | NodeBird</title>
      </Head>
      <Form onFinish={onsubmit}>
        <div>
          <label htmlFor="user">
            <br />
          </label>
        </div>
      </Form>
    </AppLayout>
  );
};

export default Signup;
